import React, { Component } from 'react';
import './add-item.css';

export default class AddItem extends Component {



  render() {
    return (
<form className="form-inline add-item">
  <div className="form-group">
    <label for="addItem" class="sr-only">Password</label>
    <input type="password" class="form-control" id="addItem" placeholder="Add a new Item" />
  </div>
  <button className="btn btn-success" type="button" id="button-addon2"
          onClick={() => this.props.onAdded('lalala')}
          >Add</button>
</form>
    );
  }
};
